export default function Recipes() {
  const searches = [
    "pizza",
    "burger",
    "cookies",
    "juice",
    "biriyani",
    "salad",
    "ice cream",
    "lasagna",
    "pudding",
    "soup",
  ];
  return (
    <div>
      <PreviousSearches />
    </div>
  );
}
